# ---------------- CONSTANTES & OUTILS ----------------
BAN_URL = "https://api-adresse.data.gouv.fr/search/"
geolocator_nominatim = Nominatim(user_agent="Miramas_Geocoding_App")
transformer_lambert93_to_wgs84 = Transformer.from_crs(CRS("EPSG:2154"), CRS("EPSG:4326"), always_xy=True)


def normalize_address(address: str):
    """Normalise une cha√Æne d'adresse pour un meilleur matching."""
    if not isinstance(address, str):
        return ""
    
    address = address.lower()
    address = address.replace("13140 miramas france", "").replace("miramas france", "").replace("miramas", "").replace("13140", "")
    address = re.sub(r'[^\w\s]', '', address)
    address = re.sub(r'\s+', ' ', address).strip()
    
    # Standardisation des abr√©viations
    abbreviations = {
        "rue": "r", "avenue": "av", "boulevard": "bd", "place": "pl",
        "chemin": "ch", "impasse": "imp", "residence": "res",
        "zone d activite": "za", "allee": "all", "route": "rte"
    }
    for full, abbr in abbreviations.items():
        address = address.replace(full, abbr)
    
    return address

def geocode_address_ban(address: str):
    """G√©ocode via l'API BAN."""
    if not isinstance(address, str) or not address.strip():
        return None, None
    try:
        r = requests.get(BAN_URL, params={"q": address, "limit": 1}, timeout=10)
        if r.status_code == 200:
            d = r.json()
            feats = d.get("features", [])
            if feats:
                coords = feats[0]["geometry"]["coordinates"]
                return coords[1], coords[0]
    except Exception:
        pass
    return None, None

def geocode_address_nominatim(address: str):
    """G√©ocode via Nominatim."""
    if not isinstance(address, str) or not address.strip():
        return None, None
    try:
        location = geolocator_nominatim.geocode(address, timeout=10)
        if location:
            return location.latitude, location.longitude
    except (GeocoderTimedOut, GeocoderServiceError):
        pass
    except Exception:
        pass
    return None, None

def reproject_insee_coords(x_coord, y_coord):
    """Reprojecte les coordonn√©es Lambert 93 en WGS84."""
    if pd.isna(x_coord) or pd.isna(y_coord):
        return None, None
    try:
        lon, lat = transformer_lambert93_to_wgs84.transform(x_coord, y_coord)
        return lat, lon
    except Exception:
        return None, None

def geocode_address_insee(address_to_find_normalized: str, insee_df_processed: pd.DataFrame):
    """Recherche une adresse normalis√©e dans le DataFrame INSEE."""
    if not isinstance(address_to_find_normalized, str) or not address_to_find_normalized.strip():
        return None, None

    match = insee_df_processed[insee_df_processed['adresse_insee_complete_normalized'] == address_to_find_normalized]
    if not match.empty:
        first_match = match.iloc[0]
        if pd.notna(first_match['insee_latitude']) and pd.notna(first_match['insee_longitude']):
            return first_match['insee_latitude'], first_match['insee_longitude']
    return None, None


